import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const Home = () => {
  return (
    <div style={homeStyle}>
      <h2>Bienvenido a Maestranza S.A</h2>
      <p>Somos una empresa dedicada a la gesti√≥n de inventarios y perfiles de usuarios.</p>
      <Carousel showThumbs={false} autoPlay infiniteLoop>
        <div>
          <img src="https://img.interempresas.net/fotos/2238938.jpeg" alt="Slide 1" style={imageStyle} />
          <p className="legend">Slide 1</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/800x300?text=Slide+2" alt="Slide 2" style={imageStyle} />
          <p className="legend">Slide 2</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/800x300?text=Slide+3" alt="Slide 3" style={imageStyle} />
          <p className="legend">Slide 3</p>
        </div>
      </Carousel>
    </div>
  );
};

const homeStyle = {
  padding: '20px',
  textAlign: 'center'
};

const imageStyle = {
  width: '100%',
  height: '500px'
};

export default Home;
